ica;\">具体快递物流时间请以实际情况为准，</span><span style=\"font-family:宋体;\"><span style=\"font-family: Helvetica;\">邮寄范围仅限中国大陆地区（新疆、西藏等除外）</span>；</span></p><p class=\"MsoNormal\">3.如参与者微信与公众号无法绑定成功或者因系统出错无法抽奖，可拨打客服热线电话‭</p><p class=\"MsoNormal\">★活动期间每人每天限量100盒。</p>\r\n                    <p class=\"MsoNormal\">\r\n                        4.为防止违规兑换，保护参与者合法权益，请参与者保留微信支付记录，以备兑奖查验。<o:p></o:p>\r\n                    </p>\r\n                    <p class=\"MsoNormal\">\r\n                        5.活动主办方有权要求实物类奖品中奖者提供更多个人身份信息（包括但不限于签名档身份证正反面复印件等信息）以验证中奖者身份或办理相关手续，如因所提供的邮寄地址或手机号码不准确（包含但不限于空号、停机、等其他情况）而造成的无法联络到中奖者导致不能兑换奖品，视为中奖者放弃领取奖品资格及由此产生的权利，损失由中奖者自行承担。\r\n                        <o:p></o:p>\r\n                    </p>\r\n                    <p class=\"MsoNormal\">\r\n                        6.活动主办方承诺参与者提交的个人信息只用于本活动相关的产品派发，不作他用。<o:p></o:p>\r\n                    </p>\r\n                    <p class=\"MsoNormal\">\r\n                        7.活动产品不找零，不转让，不能兑换现金，不开具发票。<o:p></o:p>\r\n                    </p>\r\n                    <p class=\"MsoNormal\">\r\n                        8.本次活动范围为中国大陆地区（港澳台地区除外）。<o:p></o:p>\r\n                    </p>\r\n                    <p class=\"MsoNormal\">\r\n                        9.活动主办方以及相关合作方不对因为网络传输原因而导致获奖信息错误或延误承担任何责任。<o:p></o:p>\r\n                    </p>\r\n                    <p class=\"MsoNormal\">\r\n                        10.本活动的相关事宜，由活动主办方在法律许可范围内进行解释。<o:p></o:p>\r\n                    </p>\r\n                    <p class=\"MsoNormal\">\r\n                        <o:p>&nbsp;</o:p>\r\n                    </p>\r\n                    <p style=\"white-space:normal;\">\r\n                        <span style=\"color:#222222;font-family:Consolas, \" white-space:pre-wrap;background-color:#ffffff;\"=\"\"><span style=\"color:#333333;\"></span></span>\r\n                    </p>','','',''),(21,'gift_img','basic','礼物页面图片','','images','/uploads/20200513/3759c3b51cf135183627129eafde493a.jpg','','',''),(22,'yiji_bili','basic','一级返佣比例','','string','0.12','','',''),(23,'erji_bili','basic','二级返佣比例','','string','0.08','','',''),(24,'sanji_bili','basic','三级返佣比例','','string','0.05','','',''),(25,'tixian_bili','basic','提现比例','','string','0','','',''),(26,'min_tixian','basic','最低提现金额','','string','1','','',''),(27,'ewm_bg','basic','二维码背景图','','image','/uploads/20220111/8dba4bdc5d6574c59a6f050ed2f77f4a.png','','',''),(29,'gzh_img','basic','公众号二维码','','image','/uploads/20210630/c54a65a24e1239d1ec4cf2f99dfa0087.jpg','','',''),(33,'rechage','recharge','金额列表','','checkbox','','{\"value1\":\"title1\",\"value2\":\"title2\"}','',''),(34,'recharge_jine','basic','充值金额','(,)隔开','string','10,20,30,50,100,200','','',''),(35,'game_time','basic','游戏时长','秒','number','15','','',''),(36,'jine_list','redpacket','红包雨金额列表','(,)隔开','string','0.1,0.2,0.3,0.,0.1,0.2,0.5,','','',''),(37,'fudai_list','redpacket','红包雨福袋列表','(,)隔开','string','1,2,1,0,1,0,2,0,0,0,3,2,','','',''),(38,'gonggao','basic','商品公告','','string','111','','',''),(39,'notice_list','redpacket','公告信息','','array','{\"0\":\"恭喜白头偕老获得50元红包\",\"1\":\"恭喜百草枯获得50元红包\",\"2\":\"恭喜链家地产获得50元红包\",\"3\":\"恭喜这五年获得50.56元红包\",\"4\":\"恭喜头疼获得190元红包\",\"5\":\"恭喜白头偕老获得170.13元红包\",\"6\":\"恭喜亏欠一生获得190.99元红包\",\"7\":\"恭喜难得的心获得151元红包\",\"8\":\"恭喜我早已白发苍苍获得100元红包\",\"9\":\"恭喜大萌子获得65.27元红包\",\"10\":\"恭喜雯雯获得412元红包\",\"11\":\"恭喜张佳怡获得209.70元红包\",\"12\":\"恭喜张亮同学获得30.08元红包\",\"13\":\"恭喜夏天来风获得121.10元红包\",\"14\":\"恭喜白白露获得80.50元红包\",\"15\":\"恭喜老三获得46元红包\"}','{\"value1\":\"title1\",\"value2\":\"title2\"}','',''),(40,'youfei','basic','邮费','','number','0','','',''),(41,'buy_max','basic','每日限购次数','','string','100','','',''),(42,'danmu','notice_gonggao','弹幕设置','姓名-礼物-时间','array','{\"6\":\"社会小哥-美女语音陪聊10分钟-76\",\"7\":\"还行吧-iPhone12 -54\",\"8\":\"社会勇哥-小米11Pro -3\",\"10\":\"小娜-50红包-60\",\"11\":\"小爱同学-50红包-33\",\"12\":\"开心就好-京东e卡-58\",\"13\":\"东东小哥-美女语音陪聊10分钟-30\",\"14\":\"八卦-苹果12-60\",\"15\":\"开心就好-京东e卡-58\"}','{\"value1\":\"title1\",\"value2\":\"title2\"}','',''),(43,'goods_notice','notice_gonggao','商品页公告','','string','娱乐体验 ~ 全网真正以娱乐为主的开金蛋游戏  全场正品   现货速发  体验愉悦的乐趣   为了回馈新老顾客  现在几率是大暴炸~活动仅限6.10~6.12日   每个盒子都有奖品  没有空的盒子','','',''),(44,'weihu','basic','系统维护','','switch','0','','',''),(45,'ydf_id','daifu','Z支付商户号','','string','2105341','','',''),(46,'ydf_key','daifu','Z支付商户密钥','','string','G7P0a5SwvJRm2BuhjkAgqnMWg9KrSOyp','','','');
