DROP TABLE IF EXISTS `yk_goods`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `yk_goods` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `goods_name` varchar(255) NOT NULL COMMENT '商品名称',
  `goods_image` varchar(255) NOT NULL COMMENT '商品图片',
  `goods_images` varchar(255) NOT NULL COMMENT '轮播图',
  `goods_desc` varchar(255) NOT NULL COMMENT '商品描述',
  `category_id` int(11) NOT NULL COMMENT '分类ID',
  `price` decimal(11,2) unsigned NOT NULL COMMENT '商品价格',
  `jifen` int(11) unsigned NOT NULL COMMENT '商品所需积分',
  `status` enum('big','small') NOT NULL DEFAULT 'small' COMMENT '商品类型:big=大奖,small=小奖',
  `content` text NOT NULL COMMENT '商品详情',
  `is_show` enum('0','1') NOT NULL DEFAULT '1' COMMENT '前台是否显示:0=隐藏,1=显示',
